import React from 'react';
import '../../App.css';
import HeroSectionProfile from '../ProfilePrestataire/HeroSectionProfile/HeroSectionProfile';
import BarProfileEvenement from '../ProfileOrganisateur/BarProfileEvenement/BarProfileEvenement';
import EvenementValide from '../ProfileOrganisateur/EvenementValide/EvenementValide';

function FichePrestations() {
  return (
    <>
      <HeroSectionProfile/>
      <BarProfileEvenement/>
      <EvenementValide/>
    </>
  );
}

export default FichePrestations;
